/*Table structure for table `client_site` */

DROP TABLE IF EXISTS `client_site`;

CREATE TABLE `client_site` (
  `site_id` int(11) NOT NULL AUTO_INCREMENT,
  `client_code` varchar(20) COLLATE latin1_general_ci DEFAULT NULL,
  `project_code` varchar(10) COLLATE latin1_general_ci DEFAULT NULL,
  `addr_id` int(11) DEFAULT NULL,
  `site_name` varchar(100) COLLATE latin1_general_ci DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`site_id`),
  KEY `fk_client_site_address1` (`addr_id`),
  KEY `fk_client_site_user1` (`user_id`),
  CONSTRAINT `fk_client_site_address1` FOREIGN KEY (`addr_id`) REFERENCES `address` (`addr_id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=388 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

