insert  into `comments`(`id`,`case_id`,`user_id`,`comments`,`date`) values (1,'MARA010010114','12','Cross-browser compatibility\r\nBadges won\'t self collapse in Internet Explorer 8 because it lacks support for the :empty selector.','2014-01-16 00:00:00'),(2,'MARA010010114','12','Wix provides 100s of fully-customizable, designer-made templates. Use the powerful drag n drop Editor to change anything and everything to create something original. Enhance your website by adding popular web Apps & Services, enjoy top-grade hosting and get found on search engines like Google.','2014-01-16 00:00:00'),(3,'LHDN020030114','12','dfasdfasd','2014-01-17 00:00:00'),(4,'LHDN020030114','12','asdfasdfa','2014-01-17 00:00:00'),(5,'LHDN020030114','12','kambing hitam masak kari','2014-01-17 00:00:00'),(6,'LHDN020030114','12','','2014-01-17 11:35:43'),(7,'LHDN020030114','11','asfasdfa','2014-01-17 12:14:32'),(8,'LHDN020030114','11','askldfjaklsdjflkasdj flasjdf as\ndf asjdklfj askldfj aklsdfj aklsdfj alsdfasdfjkalsdjfklasjdf\n\nasd fas\nd fjads jfklasjdfdf','2014-01-17 12:35:57'),(9,'LHDN020030114','12','Hello','2014-01-17 16:38:13'),(10,'LHDN020030114','12','asdfads','2014-01-20 14:46:13'),(11,'MARA010060114','12','hello brader','2014-01-20 17:03:27'),(12,'MARA010060114','12','yo man wassup','2014-01-22 22:06:10'),(13,'LHDN010030114','12','&quot;Kerajaan amat menghargai peranan syarikat-syarikat ini yang diakui mempunyai pelbagai sumber untuk melaksana dan menjayakan program pembangunan mapan mereka, berbanding syarikat yang sederhana dan lebih kecil saiznya,&quot; ujarnya.\n\nArtikel Penuh: http://www.utusan.com.my/utusan/Dalam_Negeri/20140125/dn_03/Wujudkan-piawaian-mesra-alam---TPM#ixzz2rQj4JrX7 \n Utusan Melayu (M) Bhd','2014-01-26 00:54:01'),(14,'LHDN010040114','12','Katanya, beliau kesal apabila orang ramai masih tidak mengetahui setiap panggilan yang mereka buat akan dijawab oleh petugas terlatih malah mampu memberi kaunseling','2014-01-26 01:24:53'),(15,'LHDN010070114','12','upd