/* Trigger structure for table `cases` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `addCase` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `addCase` AFTER INSERT ON `cases` FOR EACH ROW BEGIN
	UPDATE  seq
	SET 	cur 	= cur + inc, 
		nextval	= nextval + inc
	WHERE 
		TYPE	= 'project' 
	AND	CODE 	= new.project_code;
	
	insert into audit (case_id,activity,chg_by,chg_date) values (new.case_id,'submitted new ticket',NEW.open_by, NOW());
    END */$$


DELIMITER ;

/* Trigger structure for table `cases` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `audit` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `audit` AFTER UPDATE ON `cases` FOR EACH ROW BEGIN
 	DECLARE old_sts VARCHAR(45);
	DECLARE new_sts VARCHAR(45);	
	DECLARE old_via VARCHAR(45);
	DECLARE new_via VARCHAR(45);	
	DECLARE old_servtype VARCHAR(45);
	DECLARE new_servtype VARCHAR(45);		
	DECLARE old_cat VARCHAR(45);
	DECLARE new_cat VARCHAR(45);	
	DECLARE old_product VARCHAR(45);
	DECLARE new_product VARCHAR(45);				
	DECLARE old_flag VARCHAR(45);
	DECLARE new_flag VARCHAR(45);	
	
	IF (NEW.sn != OLD.sn) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by`, `chg_date` ) 
		VALUES 
			(New.case_id,"Serial Number", OLD.sn, NEW.sn, new.mod_by, NOW());
	END IF;
	IF (NEW.project_code != OLD.project_code) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Project", OLD.project_code, NEW.project_code, NEW.mod_by, NOW());
	END IF;
	IF (NEW.site_id != OLD.site_id) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Client Site", OLD.site_id, NEW.site_id, NEW.mod_by, NOW());
	END IF;
	IF (NEW.client_code != OLD.client_code) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Client", OLD.client_code, NEW.client_code, NEW.mod_by, NOW());
	END IF;
	IF (NEW.caller != OLD.caller) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Contact Person", OLD.caller, NEW.caller, NEW.mod_by, NOW());
	END IF;
	IF (NEW.contact != OLD.contact) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Contact No", OLD.contact, NEW.contact, NEW.mod_by, NOW());
	END IF;
	
	IF (NEW.info != OLD.info) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Additional Information", OLD.info, NEW.info, NEW.mod_by, NOW());
	END IF;
	IF (NEW.asset != OLD.asset) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Asset", OLD.asset, NEW.asset, NEW.mod_by, NOW());
	END IF;
	IF (NEW.servType != OLD.servType) THEN
		SELECT  code_name INTO old_servtype FROM code_definition
		WHERE 	code_cat = 'servicetyp' 
		AND 	CODE = OLD.servType;
	
		SELECT  code_name INTO new_servtype FROM code_definition
		WHERE 	code_cat = 'servicetyp' 
		AND 	CODE = NEW.servType;	
	
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Service Type", old_servtype, new_servtype, NEW.mod_by, NOW());
	END IF;							
	IF (NEW.via != OLD.via) THEN
		SELECT  code_name INTO old_via FROM code_definition
		WHERE 	code_cat = 'casevia' 
		AND 	CODE = OLD.via;
	
		SELECT  code_name INTO new_via FROM code_definition
		WHERE 	code_cat = 'casevia' 
		AND 	CODE = NEW.via;	
	
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Report Channel", old_via, new_via, NEW.mod_by, NOW());
	END IF;	
	IF (NEW.flag != OLD.flag) THEN
		SELECT  code_name INTO old_flag FROM code_definition
		WHERE 	code_cat = 'flag' 
		AND 	CODE = OLD.flag;
	
		SELECT  code_name INTO new_flag FROM code_definition
		WHERE 	code_cat = 'flag' 
		AND 	CODE = NEW.flag;	
	
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Priority level", old_flag, new_flag, NEW.mod_by, NOW());
	END IF;		
	IF (NEW.cat != OLD.cat) THEN
		SELECT  code_name INTO old_cat FROM code_definition
		WHERE 	code_cat = 'servicecat' 
		AND 	CODE = OLD.cat;
	
		SELECT  code_name INTO new_cat FROM code_definition
		WHERE 	code_cat = 'servicecat' 
		AND 	CODE = NEW.cat;	
		
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Case Category", old_cat, new_cat, NEW.mod_by, NOW());
	END IF;	
	IF (NEW.item != OLD.item) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Case Item", OLD.item, NEW.item, NEW.mod_by, NOW());
	END IF;	
	IF (NEW.product != OLD.product) THEN
	
		SELECT CONCAT(product_type,' - ',brand,' ',model) into old_product FROM product
		WHERE product_id = old.product;
	
		SELECT CONCAT(product_type,' - ',brand,' ',model) INTO new_product FROM product
		WHERE product_id = New.product;
	
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Case Product", old_product, new_product, NEW.mod_by, NOW());
	END IF;	
	IF (NEW.problem != OLD.problem) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Case Problem", OLD.problem, NEW.problem, NEW.mod_by, NOW());
	END IF;	
	IF (NEW.sts != OLD.sts) THEN
		
	
		SELECT  code_name INTO old_sts FROM code_definition
		WHERE 	code_cat = 'casestatus' 
		AND 	CODE = OLD.sts;
	
		SELECT  code_name INTO new_sts FROM code_definition
		WHERE 	code_cat = 'casestatus' 
		AND 	CODE = NEW.sts;
	
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Case Status", old_sts, new_sts, NEW.mod_by, NOW());
	END IF;	
	
		
	IF (NEW.remarks != OLD.remarks) THEN
		INSERT INTO audit 
			(`case_id` , `field` , `o_data` , `n_data` , `chg_by` , `chg_date` ) 
		VALUES 
			(NEW.case_id,"Remarks", OLD.remarks, NEW.remarks, NEW.mod_by, NOW());
	END IF;	
			
    END */$$


DELIMITER ;

/* Trigger structure for table `client` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `addClient` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `addClient` AFTER INSERT ON `client` FOR EACH ROW BEGIN
	insert into seq 
		(type,code,cur,nextval,max,inc)
	values
		('client',new.client_code,0,1,99,1);
