/* Trigger structure for table `project` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `addProject` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `addProject` AFTER INSERT ON `project` FOR EACH ROW BEGIN
	INSERT INTO seq 
		(TYPE,CODE,cur,nextval,MAX,inc)
	VALUES
		('project',new.project_code,0,1,99999,1);
	
	update  seq
	set 	cur 	= cur + inc, 
		nextval	= nextval + inc
	where 
		type	= 'client' 
	and	code 	= new.client_code;
    END */$$


DELIMITER ;

