/* Event structure for event `SLA` */

/*!50106 DROP EVENT IF EXISTS `SLA`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `SLA` ON SCHEDULE EVERY 1 HOUR STARTS '2013-12-16 23:22:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
	
		UPDATE `cases` 
		SET `MTTC` = getDur(IFNULL(response_time,NOW()),open_date),
		    `MTTA` = getDur(IFNULL(onsite_time,NOW()),open_date),
		    `MTTR` = getDur(IFNULL(resolve_time,NOW()),open_date)
		WHERE  `response_time` IS NULL OR MTTC=''
		OR `onsite_time` IS NULL OR MTTA=''
		OR `resolve_time` IS NULL OR MTTR='';
		
	END */$$
