/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getTime`(date1 INT(100)) RETURNS varchar(100) CHARSET latin1 COLLATE latin1_general_ci
    DETERMINISTIC
BEGIN
	DECLARE maxAddrid VARCHAR(100);
	SELECT  CONCAT(	FLOOR(date1 / 86400),':', TIME_FORMAT(SEC_TO_TIME(date1 % 86400 ),'%H:%i')) INTO maxAddrid;
	RETURN maxAddrid;
      END */$$
